function Map() {
    return(
        <GoogleMap
            defaultZoom={8}
            defaultCenter={{ lat: YOUR_LATITUDE, lng: YOUR_LATITUDE }}
        />
    );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

export default Map;
